import Particles from 'particles.js'

function ParticlesBg() {


    return(
      <div>
        <Particles 
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              }
            },
          },
        }} />


      </div> 
    );

}


export default ParticlesBg;
